import React from 'react';
import {Box, Heading} from "@chakra-ui/react";

const Assignment = () => {
    return (
        <Box w={'100%'} minH={'100vh'}>
            <Heading>Assigned</Heading>
        </Box>
    );
};

export default Assignment;
